import React, {Fragment} from 'react';

function App() {
  return (

    <Fragment>
      <h1>Administrador de pacientes</h1>

      <div className="container">
        <div className="row">
          <div className="one-half column">
            Primero
          </div> 
          <div className="one-half column">
            Segundo

          </div>
        </div>
      </div>


    </Fragment>

  );
}

export default App;
